    return (
        <header className="header flex flex-jc-sb flex-ai-c">
            <nav>
            <h1 className="header__name">Where in the world?</h1>
            <div className="header__btn">
                <IoMoonOutline/>
                <span>Dark Mode</span>
            </div>
            </nav>

        </header>
    )
}

export default Navbar
